import React from 'react' ;
import './details.css';

function Details ({historyData}){


    function getImages(){
        let images = historyData.imgs;
        let imgTags = images.map((img,ind)=>{
            return (
                <div key={ind} className="  br4">
                    <img src={img} className="br-100 shadow" alt={`image number ${ind}`}/>
                </div>
            )
        })
        return imgTags;

    }
    let imgTags = getImages();
    return (

        <>
        <div id="imageContainer" className="row  ma4 shadow">
            {imgTags}
        </div>
        <div>
            {/* {rows} */}
        </div>

        </>
    )
}
export default Details ;
